import React from 'react';

const OverviewSection = () => {
  return (
    <section id="overview" className="text-center py-8">
      <div className="container mx-auto">
        <h2 className="text-3xl font-bold mb-4">Equity Wise</h2>
        <p className="text-lg">
          Equity Wise is a comprehensive tool for managing equity portfolio. The app has been carefully designed to help you manage all your stocks at one place. The app helps you to not only manage your portfolio but also your wishlist.
          Our offerings include real-time stock market data, portfolio tracking, and financial analysis tools to help you make informed investment decisions.
        </p>
      </div>
    </section>
  );
};

export default OverviewSection;
